	add("resemblance", "{\"term\":\"resemblance\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027resemblance\u0027 from Old french (842-ca. 1400) (compare French \u0027ressemblance\u0027 .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality or state of resembling; likeness; similitude; similarity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027: Chris Horrocks\u0026lt;!-- illustrated by Zoran Jevtic --\u0026gt;, \u0027Introducing Foucault\u0027, page 67, \u0027The Renaissance Episteme\u0027 (Totem Books, Icon Books; ISBN 1840460865\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Words\u0027\u0027 and \u0027\u0027things\u0027\u0027 were united in their \u0027\u0027\u0027resemblance\u0027\u0027\u0027. Renaissance man thought in terms of \u0027\u0027similitudes\u0027\u0027: the theatre \u0027of\u0027 life, the mirror \u0027of\u0027 nature. There were four ranges of \u0027\u0027resemblance\u0027\u0027.\u0026lt;br/\u0026gt;\u0027\u0027Aemulation\u0027\u0027 was similitude within distance: the sky resembled a face because it had “eyes” — the sun and moon.\u0026lt;br/\u0026gt;\u0027\u0027Convenientia\u0027\u0027 connected things near to one another, e.g. animal and plant, making a great “chain” of being.\u0026lt;br/\u0026gt;\u0027\u0027Analogy\u0027\u0027: a wider range based less on likeness than on similar relations.\u0026lt;br/\u0026gt;\u0027\u0027Sympathy\u0027\u0027 likened anything to anything else in universal attraction, e.g. the fate of men to the course of the planets.\u0026lt;br/\u0026gt;A “signature” was placed on all things by God to indicate their affinities — but it was hidden, hence the search for arcane knowledge. Knowing was \u0027\u0027guessing\u0027\u0027 and \u0027\u0027interpreting\u0027\u0027, not observing or demonstrating\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"That which resembles, or is similar; a representation; a likeness\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A comparison; a simile\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Probability; verisimilitude\", \"priority\":6}]}, \"synonyms\":{}}");

	add("resentment", "{\"term\":\"resentment\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027ressentiment\u0027 from \u0027ressentir\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A feeling of anger or displeasure stemming from belief that one has been wronged by others or betrayed; indignation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1812\u0027\u0027, w:Jane Jane Austen, \u0027Pride and Prejudice\u0027, Chapter\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Amongst the most violent against him was Mrs. Bennet, whose dislike of his general behaviour was sharpened into particular \u0027\u0027resentment\u0027\u0027 by his having slighted one of her daughters\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The state of holding something in the mind as a subject of contemplation, or of being inclined to reflect upon it; feeling; impression\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Dr. H. Mor\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"He retains vivid \u0027\u0027resentments\u0027\u0027 of the more solid morality\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Jeremy Taylo\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"It is a greater wonder that so many of them die, with so little \u0027\u0027resentment\u0027\u0027 of their danger\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"satisfaction; gratitud\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1651\u0027\u0027, \u0027The Council Book\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"The Council taking notice of the many good services performed by Mr. John Milton have thought fit to declare their \u0027\u0027resentment\u0027\u0027 and good acceptance of the same\", \"priority\":11}]}, \"synonyms\":{}}");

