	add("reservoir", "{\"term\":\"reservoir\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027réservoir\u0027 (collection place) (fig.), \u0027réservoir\u0027 (storehouse) (lit.). in turn from French \u0027réserver\u0027 (to reserve, keep) \u0026lt;ref\u0026gt;[http://www.etymonline.com/index.php?term\u003dreservoir Online Etymology Dictionary – Reservoir]\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A place where anything is kept in stor\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A large natural or artificial lake used as a source of water supply\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A small intercellular space, often containing resin, essential oil, or some other secreted matter\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A supply or source of something\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"passage\u003dBats host many high-profile viruses that can infect humans, including severe acute respiratory syndrome and Ebola. A recent study explored the ecological variables that may contribute to bats’ propensity to harbor such zoonotic diseases by comparing them with another order of common \u0027\u0027reservoir\u0027\u0027 hosts: rodents\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A species that acts as host to a zoonosis when it is not causing acute illness in other susceptible species\", \"priority\":6}]}, \"synonyms\":{}}");

