	add("residuum", "{\"term\":\"residuum\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027residuum\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The residue, remainder or rest of somethin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The solid material remaining after the liquid in which it was dissolved has been evaporated; a residue\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A binary function from [0,1] \u0026amp;times; [0,1] to [0,1] which is defined in terms of the t-norm as follows: \u0026lt;math\u0026gt; x rightarrow y \u003d sup { z z * x leqslant y }\u0026lt;/math\u0026gt;, where \u0026lt;math\u0026gt;*\u0026lt;/math\u0026gt; denotes the t-norm function and \u0026lt;math\u0026gt; sup\u0026lt;/math\u0026gt; denotes the supremum\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027residuum\u0027\u0027 of the minimum t-norm is a function \u0026lt;math\u0026gt; rightarrow\u0026lt;/math\u0026gt; such that \u0026lt;math\u0026gt; x rightarrow y \u003d begin{cases} y, \u0026amp; text{if } x \u0026gt; y 1, \u0026amp; text{if } x leqslant y . end{cases}\u0026lt;/math\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The residue of an estate\", \"priority\":5}]}, \"synonyms\":{}}");

