	add("resistor", "{\"term\":\"resistor\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who resists, especially a person who fights against an occupying army\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An electric component that transmits current in direct proportion to the voltage across it\", \"priority\":2}]}, \"synonyms\":{}}");

	add("reskin", "{\"term\":\"reskin\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|re|skin|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something that uses the exact same model as something else, but has superficial differences such as textures\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Wendy Despain, \u0027100 Principles of Game Design\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The result would be a \u0027\u0027reskin\u0027\u0027 of an old game instead of an interesting new game\", \"priority\":3}]}, \"synonyms\":{}}");

	add("resolution", "{\"term\":\"resolution\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"Latin\", \"anglo-norman\"], \"text\":\"Recorded since 1412, as Middle english (1100-1500) \u0027resolucioun\u0027 \u0026quot;a breaking into parts\u0026quot;, either from Anglo-norman or directly from Latin \u0027resolūtiō\u0027 (a loosening, solution) from \u0027resolvere\u0027 (to loosen) itself from the intensive prefix re- + solvere \u0027to loosen\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A strong will, determination\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The state of being resolute\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A statement of intent, a vo\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The act of discerning detail\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/pub/2013/4/tiny-lenses-see-the-big-picture Tiny Lenses See the Big passage\u003dThe single-imaging optic of the mammalian eye offers some distinct visual advantages. Such lenses can take in photons from a wide range of angles, increasing light sensitivity. They also have high spatial \u0027\u0027resolution\u0027\u0027, resolving incoming images in minute detail\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The degree of fineness with which an image can be recorded or produced, often expressed as the number of pixels per unit of length (typically an inch\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The number of pixels in an image being stored or displayed\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The process of determining the meaning of a symbol or address; lookup\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"name \u0027\u0027resolution\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The act or process of solving; solution\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027resolution\u0027\u0027 of an equation\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A formal statement adopted by an assembly\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The separation of the constituent parts (of a spectrum etc\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"The degree of fineness of such a separation\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"Progression from dissonance to consonance; a chord to which such progression is made\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The moment in which the conflict ends and the outcome of the action is clear\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"medicine) In a pathological process, the phase during which pathogens and damaged tissues are removed by macrophages\", \"priority\":17}]}, \"synonyms\":{}}");

	add("resolutioner", "{\"term\":\"resolutioner\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|resolution|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who makes a resolution; one who joins with others in a declaration or resolution\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A member of a party in the Church of Scotland in the 17th century\", \"priority\":2}]}, \"synonyms\":{}}");

	add("resolvability", "{\"term\":\"resolvability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality or condition of being resolvable\", \"priority\":1}]}, \"synonyms\":{}}");

	add("resolvableness", "{\"term\":\"resolvableness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|resolvable|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being resolvable\", \"priority\":1}]}, \"synonyms\":{}}");

	add("resonance", "{\"term\":\"resonance\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027resonance\u0027 (French \u0027résonance\u0027 , from Latin \u0027resonantia\u0027 (echo) from \u0027resonō\u0027 (i resound)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The condition of being resonant\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A resonant sound, ech\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Something that evokes an association, or a strong emotion\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The increase in the amplitude of an oscillation of a system under the influence of a periodic force whose frequency is close to that of the system\u0027s natural frequency\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A short-lived subatomic particle that cannot be observed directly\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, When experiments with the first ‘atom-smashers’ took place in the 1950s to 1960s, many short-lived heavier siblings of the proton and neutron, known as ‘\u0027\u0027resonances\u0027\u0027’, were discovered. — Frank Close, \u0027Particle Physics: A Very Short Introduction\u0027 (Oxford 2004, p. 35\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An increase in the strength or duration of a musical tone produced by sympathetic vibration\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The property of a compound that can be visualized as having two structures differing only in the distribution of electrons\", \"priority\":8}]}, \"synonyms\":{}}");

	add("resource", "{\"term\":\"resource\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027resource|lang\u003dfro\u0027 () from Old french (842-ca. 1400) \u0027resourdre\u0027 from Latin \u0027resurgere\u0027 (to rise again, spring up anew) See resourd, resurgent, source.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Something that one uses to achieve an objective, e.g. raw materials or personnel\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/pub/2013/5/will-ac-put-a-chill-on-the-global-energy-supply Will AC Put a Chill on the Global Energy passage\u003dNevertheless, it is clear that the global energy demand for air-conditioning will grow substantially as nations become more affluent,. This trend will put additional strain not only on global energy \u0027\u0027resources\u0027\u0027 but also on the environmental prospects of a warming planet\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A person\u0027s capacity to deal with difficulty\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dThis time was most dreadful for Lilian. Thrown on her own \u0027\u0027resources\u0027\u0027 and almost penniless, she maintained herself and paid the rent of a wretched room near the hospital by working as a charwoman, sempstress, anything. In a moment she had dropped to the level of a casual labourer\", \"priority\":4}]}, \"synonyms\":{}}");

	add("resourcefulness", "{\"term\":\"resourcefulness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|resourceful|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the ability to cope with difficult situations, or unusual problems\", \"priority\":1}]}, \"synonyms\":{}}");

	add("respecification", "{\"term\":\"respecification\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|re|specification|lang\u003den}} / {{suffix|respecify|ication|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act or process of respecifying; a change from a previous specification\", \"priority\":1}]}, \"synonyms\":{}}");

	add("respect", "{\"term\":\"respect\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027respect\u0027 from Old french (842-ca. 1400) \u0027respect\u0027 also \u0027respit\u0027 {{gloss|\u0026quot;respect, regard, consideration\u0026quot;; \u0026gt; \u0027respite\u0027 }, from Latin \u0027respectus\u0027 (a looking at, regard, respect) perfect passive participle of \u0027respiciō\u0027 (look at, look back upon, respect) from \u0027re-\u0027 (back) + \u0027speciō\u0027 (look at)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"an attitude of consideration or high regar\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"regar\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He is an intellectual giant, and I have great \u0027\u0027respect\u0027\u0027 for him\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"we do respect people for their dignity and worth\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"good opinion, honor, or admiratio\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Polite greetings, often offered as condolences after a death\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The mourners paid their last \u0027\u0027respects\u0027\u0027 to the deceased poet\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"a particular aspect of somethin\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"This year\u0027s model is superior to last year\u0027s in several \u0027\u0027respects\", \"priority\":9}]}, \"synonyms\":{}}");

	add("respectability", "{\"term\":\"respectability\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|respect|ability|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being respectable\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Such a scandal as the prosecution of a brother for forgery—with a verdict of guilty—is a most truly horrible, deplorable, fatal thing. It takes the \u0027\u0027respectability\u0027\u0027 out of a family perhaps at a critical moment, when the family is just assuming the robes of \u0027\u0027respectability\u0027\u0027:it is a black spot which all the soaps ever advertised could never wash off\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The class of respectable people\", \"priority\":3}]}, \"synonyms\":{}}");

	add("respecter", "{\"term\":\"respecter\", \"etymology\":{\"influencers\":[], \"languages\":[\"French\", \"Latin\"], \"text\":\"Borrowed from Latin {{m|la|respecto|respectō, respectāre}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who regards or judges with partiality; one who respects\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Robert Louis Stevenson, \u0027Strange Case of Dr. Jekyll and Mr. Hyde\u0027, chapter\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"For these two were old friends, old mates both at school and college, both thorough respecters of themselves and each other\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A person who respects someone or something; usually used in the negative; \u0026quot;X is no respecter of Y\u0026quot\", \"priority\":4}]}, \"synonyms\":{}}");

	add("respectfulness", "{\"term\":\"respectfulness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|respectful|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The characteristic of being respectful\", \"priority\":1}]}, \"synonyms\":{}}");

	add("respects", "{\"term\":\"respects\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"regards or respect expressed for a deceased person, usually at the same time as offering condolences to other mourners\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Please come to the funeral service and pay your last \u0027\u0027respects\u0027\u0027 for her grandmother\", \"priority\":2}]}, \"synonyms\":{}}");

	add("respiration", "{\"term\":\"respiration\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"Latin\"], \"text\":\"Middle english (1100-1500) \u0027respiracioun\u0027, from Latin \u0027respiratio\u0027, from \u0027respirare\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The process of inhaling and exhaling; breathing, breath\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An act of breathing; a breath\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1931\u0027\u0027, William Faulkner, \u0027Sanctuary\u0027, Vintage 1993, p. 76\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Gowan snored, each \u0027\u0027respiration\u0027\u0027 choking to a huddle fall, as though he would never breathe again\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Any similar process in an organism that lacks lungs that exchanges gases with its environment\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The process by which cells obtain chemical energy by the consumption of oxygen and the release of carbon dioxide\", \"priority\":6}]}, \"synonyms\":{}}");

	add("respite", "{\"term\":\"respite\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman and Old french (842-ca. 1400) \u0027respit\u0027 (rest) from Latin {{m|la|respectus}}. Doublet of {{m|en|respect}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A brief interval of rest or relief\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Denha\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Some pause and \u0027\u0027respite\u0027\u0027 only I require\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I crave but four day\u0027s \u0027\u0027respite\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://openlibrary.org/works/OL1097634W The Mirror and the passage\u003dIt was a joy to snatch some brief \u0027\u0027respite\u0027\u0027, and find himself in the rectory drawing–room. Listening here was as pleasant as talking; just to watch was pleasant. The young priests who lived here wore cassocks and birettas; their faces were fine and mild, yet really strong, like the rector\u0027s face; and in their intercourse with him and his wife they seemed to be brothers\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027 May 23, \u0026quot;[http://www.nytimes.com/2013/05/24/world/europe/british-leader-david-cameron-faces-rebellion-in-his-party.html?pagewanted\u003dall\u0026amp;_r\u003d0 British Leader’s Liberal Turn Sets Off a Rebellion in His Party],\u0026quot; \u0027New York Times\u0027 \u0026lt;small\u0026gt;(retrieved 29 May 2013)\u0026lt;/small\u0026gt\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Mr. Cameron had a \u0027\u0027respite\u0027\u0027 Thursday from the negative chatter swirling around him when he appeared outside 10 Downing Street to denounce the murder a day before of a British soldier on a London street\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A reprieve, especially from a sentence of death\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The delay of appearance at court granted to a jury beyond the proper term\", \"priority\":10}]}, \"synonyms\":{}}");

	add("resplendence", "{\"term\":\"resplendence\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The property of being, or that which causes something to be, resplendent\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Son! thou in whom my glory I behold / In full \u0027\u0027resplendence\u0027\u0027, heir of all my might\", \"priority\":3}]}, \"synonyms\":{}}");

	add("responsa", "{\"term\":\"responsa\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"Latin \u0027responsa\u0027, plural of \u0027responsum\u0027, \u0026quot;answer\u0026quot;.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A body of written decisions and rulings given by legal scholars in response to questions addressed to them\", \"priority\":1}]}, \"synonyms\":{}}");

	add("response", "{\"term\":\"response\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Old french (842-ca. 1400) ultimately from the Latin \u0027respōnsum\u0027 a nominal use of the neuter form of \u0027respōnsus\u0027 the perfect passive participle of \u0027respondeō\u0027 from \u0027re\u0027 (again) + \u0027spondeō\u0027 (promise)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An answer or reply, or something in the nature of an answer or reply\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of responding or replying; reply: as, to speak in response to a question\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An oracular answer\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"liturgics\u0027) A verse, sentence, phrase, or word said or sung by the choir or congregation in sequence or reply to the priest or officiant\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"liturgics\u0027) A versicle or anthem said or sung during or after a lection; a respond or responsory\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A reply to an objection in formal disputation\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An online advertising performance metric representing one click-through from an online ad to its destination URL\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A reaction to a stimulus or provocation\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/feature/2013/4/stents-to-prevent-stroke Stents to Prevent passage\u003dAs we age, the major arteries of our bodies frequently become thickened with plaque, a fatty material with an oatmeal-like consistency that builds up along the inner lining of blood vessels. The reason plaque forms isn’t entirely known, but it seems to be related to high levels of cholesterol inducing an inflammatory \u0027\u0027response\u0027\u0027, which can also attract and trap more cellular debris over time\", \"priority\":9}]}, \"synonyms\":{}}");

	add("responsibility", "{\"term\":\"responsibility\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of being responsible, accountable, or answerable\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Responsibility\u0027\u0027 is a heavy burden\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A duty, obligation or liability for which someone is held accountable\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Why didn\u0027t you clean the house? That was your \u0027\u0027responsibility\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027responsibility\u0027\u0027 of the great states is to serve and not to dominate the world\u0027 - s:Harry S. Harry S. Truma\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The obligation to carry forward an assigned task to a successful conclusion. With responsibility goes authority to direct and take the necessary action to ensure success. (JP 1-02 Department of Defense Dictionary of Military and Associated Terms\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The obligation for the proper custody, care, and safekeeping of property or funds entrusted to the possession or supervision of an individual. (JP 1-02 Department of Defense Dictionary of Military and Associated Terms\", \"priority\":7}]}, \"synonyms\":{}}");

	add("responsion", "{\"term\":\"responsion\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An answer or reply; a response\", \"priority\":1}]}, \"synonyms\":{}}");

	add("responsiveness", "{\"term\":\"responsiveness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality or state of being responsive\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The ability of a machine to adjust to external influences\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027responsiveness\u0027\u0027 of my old PC is nearly zero\", \"priority\":3}]}, \"synonyms\":{}}");

	add("ressentiment", "{\"term\":\"ressentiment\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"French\"], \"text\":\"From the French \u0027ressentiment\u0027 in the second sense after the German \u0027ressentiment\u0027 Compare \u0027resentment\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A sense of resentment arising from suppressed feelings of envy and hatred, often leading to a frustrated sense of inferiority that may lead to various social repercussions\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1973\u0027\u0027, “Nietzsche: The Revaluation of Values” in \u0027Nietzsche: A Collection of Critical Essays\u0027, edited by , : w:Doubleday Anchor Books, ISBN 0385033443, page 157\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"When the weak call the strong evil the move is not merely defensive; it is also an expression of that peculiar malice which Nietzsche referred to as \u0027\u0027\u0027ressentiment\u0027\u0027\u0027. Those who cultivate humility and the other propitiatory virtues to cloak their weakness nourish an envious resentment against those stronger than themselves\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"ibidem\u0027, page 167\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"If his attack on Christian morality and on other moralities is going to be worth anything he has got to be \u0027right\u0027 about the effect of teaching pity and justice — that it merely hides the \u0027\u0027\u0027ressentiment\u0027\u0027\u0027 of the weak while it does injury to the strong\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, \u0027The Better Angels of Our Nature\u0027, Penguin 2012, page 632\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Historians such as Liah Greenfield and Daniel Chirot have attributed the major wars and genocides in the early decades of the 20th century to \u0027\u0027ressentiment\u0027\u0027 in Germany and Russia\", \"priority\":7}]}, \"synonyms\":{}}");

	add("restafarian", "{\"term\":\"restafarian\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|REST|Rastafarian|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A programmer who uses REST (Representational State Transfer\", \"priority\":1}]}, \"synonyms\":{}}");

	add("restart", "{\"term\":\"restart\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|re|start|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of starting something again\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"After the \u0027\u0027restart\u0027\u0027 of my browser, the problem went away\", \"priority\":2}]}, \"synonyms\":{}}");

	add("restaurant", "{\"term\":\"restaurant\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{borrowing|fr|restaurant|lang\u003den}}, from the verb \u0027restaurer\u0027 from Latin \u0027restaurans\u0027 present participle of \u0027restauro\u0027 (i restore) from the name of the \u0027restorative\u0027 soup served in the first establishments.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An eating establishment in which diners are served food at their tables\", \"priority\":1}]}, \"synonyms\":{}}");

	add("restauranter", "{\"term\":\"restauranter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|restaurant|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who owns or operates a restaurant\", \"priority\":1}]}, \"synonyms\":{}}");

	add("rester", "{\"term\":\"rester\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|rest|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who rests\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, Diane P. Koenker, \u0027Club Red: Vacation Travel and the Soviet Dream\u0027 (page 136\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Their ideal vacation experience made the \u0027\u0027rester\u0027\u0027 the focus of care, the object of medical, cultural, and culinary attention\", \"priority\":3}]}, \"synonyms\":{}}");

	add("resting", "{\"term\":\"resting\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The action of rest; repose; inactivity; reliance; confidence\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1865\u0027\u0027, Merritt Munson, \u0027The History of Moses and the Israelites\u0027 (page 199\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Hence, if the universal Father had personally controlled the movements of the Israelites, and directed the course, the motions, and the \u0027\u0027restings\u0027\u0027, of that cloud\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A place where one can rest; a resting-place\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A pause; a break; an interlude\", \"priority\":5}]}, \"synonyms\":{}}");

	add("restitution", "{\"term\":\"restitution\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027restitucion\u0027 from Latin \u0027restitutio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A process of compensation for losses\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of making good or compensating for loss or injury\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Spense\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027restitution\u0027\u0027 of ancient rights unto the crown\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Sandy\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"He \u0027\u0027restitution\u0027\u0027 to the value makes\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A return or restoration to a previous condition or position\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027restitution\u0027\u0027 of an elastic body\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"That which is offered or given in return for what has been lost, injured, or destroyed; compensation\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"The movement of rotation which usually occurs in childbirth after the head has been delivered, and which causes the latter to point towards the side to which it was directed at the beginning of labour\", \"priority\":10}]}, \"synonyms\":{}}");

	add("restlessness", "{\"term\":\"restlessness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|restless|ness|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or condition of being restless; an inability to be still, quiet, at peace or comfortable\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"She sat and fidgeted out of \u0027\u0027restlessness\u0027\u0027 as she waited\", \"priority\":2}]}, \"synonyms\":{}}");

	add("restoration", "{\"term\":\"restoration\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the process of bringing an object back to its original state; the process of restoring somethin\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027restoration\u0027\u0027 of this painting will take years\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027restoration\u0027\u0027 of this medieval church involved undoing all the Victorian modifications\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"the return of a former monarchy or monarch to power, usually after having been forced to step dow\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027restoration\u0027\u0027 of the House of Stuart took place a few years after the death of Cromwell\", \"priority\":5}]}, \"synonyms\":{}}");

	add("restore", "{\"term\":\"restore\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027restorer\u0027 (Modern French: \u0027restaurer\u0027 , from Latin \u0027restaurare\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of recovering data or a system from a backup\", \"priority\":1}]}, \"synonyms\":{}}");

	add("restorer", "{\"term\":\"restorer\", \"etymology\":{\"influencers\":[], \"languages\":[\"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Latin \u0027restauro\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who restores\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2014,\u0027\u0027 , \u0027Blessed. Cursed. Claimed.\u0027, National Geographic (December 2014)[http://ngm.nationalgeographic.com/2014/12/pilgrim-roads/salopek-text\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Inside its exhibit hall, behind panes of glass, in a white-lit lab, a team of \u0027\u0027restorers\u0027\u0027 works on an ancient Byzantine floor: 44 square yards of stone shards rescued from Lot’s Cave Monastery\", \"priority\":3}]}, \"synonyms\":{}}");

	add("restraint", "{\"term\":\"restraint\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027restreinte\u0027 more at {{l/en|restrain}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"something that restrains, ties, fastens or secure\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Make sure all the \u0027\u0027restraints\u0027\u0027 are tight\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"control or caution; reserv\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Try to exercise \u0027\u0027restraint\u0027\u0027 when talking to your boss\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"November 2 2014\u0027\u0027, Daniel Taylor, \u0026quot;[http://www.theguardian.com/football/2014/nov/02/manchester-city-manchester-united-premier-league-match-report Sergio Agüero strike wins derby for Manchester City against 10-man United],\u0026quot; \u0027guardian.co.uk\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"City will feel nonplussed when they review the tape and Pellegrini had to summon all his \u0027\u0027restraint\u0027\u0027 in the post-match interviews\", \"priority\":6}]}, \"synonyms\":{}}");

	add("restriction", "{\"term\":\"restriction\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027restriction\u0027 Middle french (ca. 1400-1600) \u0027restriction\u0027 and their source, \u0027\u0027 from Latin \u0027restringere\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of restricting, or the state of being restricted\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A regulation or limitation that restricts\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"biology) The mechanism by which a cell degrades foreign DNA material\", \"priority\":3}]}, \"synonyms\":{}}");

