	add("résumé", "{\"term\":\"résumé\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"{{borrowing|fr|lang\u003den}} \u0027résumé\u0027 past participle of \u0027résumer\u0027 (to summarize) from Latin \u0027resumere\u0027 (to take back) compare \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A summary or synopsis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1919\u0027\u0027, (Hector Hugh Munro), ‘Excepting Mrs. Pentherby’, \u0027The Toys of Peace\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"On one occasion Mrs. Val Gwepton, who was not blessed with the most reposeful of temperaments, fairly let herself go, and gave Mrs. Pentherby a vivid and truthful \u0027\u0027\u0027résumé\u0027\u0027\u0027 of her opinion of her\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1978\u0027\u0027, Royal Society of South Australia, \u0027Transactions of the Royal Society of South Australia\u0027, Volumes 102-103, %22r%C3%A9sum%C3%A9s%22+australia+-intitle:%22r%C3%A9sum%C3%A9%7Cr%C3%A9sum%C3%A9s%22+-inauthor:%22%22\u0026amp;dq\u003d%22r%C3%A9sum%C3%A9%22|%22r%C3%A9sum%C3%A9s%22+australia+-intitle:%22r%C3%A9sum%C3%A9%7Cr%C3%A9sum%C3%A9s%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dPAzXD0bJIz\u0026amp;sig\u003dl5d3L7NMW-quPTHwD2A2HF7S_Po\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d2X4WUM2fEoeviQeuioGgCg\u0026amp;redir_esc\u003dy page 79\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A \u0027\u0027résumé\u0027\u0027 of diagnostic characters of the five families represented in Australia is also given, and a list of the 19 genera described from Australia is include\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, \u0027The Guardian\u0027, 14 Jun 1999\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"However, a brief \u0027\u0027résumé\u0027\u0027 of recent weddings, royal and otherwise, reveals that Edward and Sophie\u0027s big day could be in danger of being badly out of step\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A curriculum vitae; an account of one’s employment history and qualifications (often for presentation to a potential future employer when applying for a job\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, Tony Martin, \u0027Lolly Scramble: A Memoir of Little Consequence\u0027, Pan Macmillan Australia, %22r%C3%A9sum%C3%A9s%22+australia+-intitle:%22r%C3%A9sum%C3%A9%7Cr%C3%A9sum%C3%A9s%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dOoBSzltii6\u0026amp;sig\u003d2o46OIFWgeOnrSF8i8cWrTKajns\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dt4YWULDjK7GViAfyrIH4DQ\u0026amp;redir_esc\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"%22r%C3%A9sum%C3%A9s%22%20australia%20-intitle%3A%22r%C3%A9sum%C3%A9%7Cr%C3%A9sum%C3%A9s%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"It was this piffling \u0027\u0027résumé\u0027\u0027 that accompanied me to Auckland, where I hoped to get a foot in with the city′s biggest ‘nonprofessional’ theatre group, the New Independent\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Helen Borger, \u0027Human Resources\u0027, Career FAQs, Australia, %22r%C3%A9sum%C3%A9s%22+australia+-intitle:%22r%C3%A9sum%C3%A9%7Cr%C3%A9sum%C3%A9s%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003d40WP6c5POi\u0026amp;sig\u003d6_w3L3TuLWxIGoi6lJjFoOEkTvE\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d2X4WUM2fEoeviQeuioGgCg\u0026amp;redir_esc\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"%22r%C3%A9sum%C3%A9s%22%20australia%20-intitle%3A%22r%C3%A9sum%C3%A9%7Cr%C3%A9sum%C3%A9s%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 122\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Résumés\u0027\u0027 have a particular structure that you should follow – it′s what you say in it that makes yours stand out from the rest\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Monica Makari, \u0027How to Find a Job in Australia\u0027, Revised edition, How to...Books, Australia, %22r%C3%A9sum%C3%A9s%22+australia+-intitle:%22r%C3%A9sum%C3%A9%7Cr%C3%A9sum%C3%A9s%22+-inauthor:%22%22\u0026amp;source\u003dbl\u0026amp;ots\u003dRJ0m0MHnb_\u0026amp;sig\u003dqCIaIZokjDGXpXd9hMfEO56IrQw\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d2X4WUM2fEoeviQeuioGgCg\u0026amp;redir_esc\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"%22r%C3%A9sum%C3%A9s%22%20australia%20-intitle%3A%22r%C3%A9sum%C3%A9%7Cr%C3%A9sum%C3%A9s%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 34\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"A well written CV (Curriculum Vitae) or \u0027\u0027résumé\u0027\u0027 is the most important document when looking for a job, your first opportunity to present yourself and it can open or close the door to an interview\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"1995\u0027\u0027, Gary Wolf, \u0026quot;The Curse of Xanadu\u0026quot;, [http://www.wired.com/wired/archive/3.06/xanadu.html?pg\u003d16\u0026amp;topic\u003d Wired Magazine\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"The match between Stiegler and Xanadu was doubly unlikely; not only was Stiegler happily unemployed, but the Xanadu programmers did not seem to place high value on management personnel. As Stiegler tells it, the original plan during the first days at Autodesk was to get somebody with a good \u0027\u0027résumé\u0027\u0027 and stick him in a closet until somebody from Autodesk came to visit, at which point the obedient manager could be trotted out to prove that the hackers were under control. This was hardly Stiegler\u0027s style\", \"priority\":19}]}, \"synonyms\":{}}");

