	add("resurrection", "{\"term\":\"resurrection\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027resurrectiun\u0027, from Old french (842-ca. 1400) \u0027resurrection\u0027 (French: \u0027résurrection\u0027), from \u0027resurrectionem\u0027 (accusative of \u0027resurrectio\u0027) from Latin \u0027resurgere\u0027 (to rise again) from \u0027\u0027lang\u003dla|re-\u0027 () + \u0027surgere\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of arising from the dead and becoming alive again\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The Resurrection\u0027\u0027: The resurrection of Jesus Christ from the dead\", \"priority\":2}]}, \"synonyms\":{}}");

	add("resveratrol", "{\"term\":\"resveratrol\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A phenolic substance, \u00273,5,4\u0027-trihydroxystilbene\u0027, a stilbenoid and phytoalexin, that is found in some fruits and nuts, and in red wine, and is reputed to have some beneficial properties for humans\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Massimo Maffei, \u00277: Biochemistry, physiology and bioengineering of bioactive compounds from plants used as dietary supplements\u0027, Massimo Maffei (editor), \u0027Dietary Supplements of Plant Origin: A Nutrition and Health Approach\u0027, [http://books.google.com.au/books?id\u003d_2ENecZmr_YC\u0026amp;pg\u003dPA152\u0026amp;dq\u003d%22resveratrol%22%7C%22resveratrols%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dmOOGU6yYOsfOlAWcuIGQBQ\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22resveratrol%22%7C%22resveratrols%22\u0026amp;f\u003dfalse page 152\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Resveratrol\u0027\u0027 (3,4,5-trihydroxy-\u0027trans\u0027-stilbene) is a phenolic compound of the stilbene family present in wines and various parts of the grape, including the skin, and shows antioxidant and antiproliferative activities\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Diane F. Birt, Weiqun Wang, Nancy Paiva, Angela Au, Chilly Chung, Laura Schmitt, Yu Jiang, \u0027Chapter 5: Cancer Prevention by Phytochemicals, Modulation of Cell Cycle\u0027, Mark S. Meskin, Wayne R. Bidlack, Audra J. Davies, Douglas S. Lewis, R. Keith Randolph (editors), \u0027Phytochemicals: Mechanisms of Action\u0027, Volume 4, [http://books.google.com.au/books?id\u003dm7h3Y39ztQEC\u0026amp;pg\u003dPA64\u0026amp;dq\u003d%22resveratrol%22%7C%22resveratrols%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dmOOGU6yYOsfOlAWcuIGQBQ\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22resveratrol%22%7C%22resveratrols%22\u0026amp;f\u003dfalse page 64\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Resveratrol\u0027\u0027 was first identified in grape vines in 1976 and in wine in 1992\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Yiwei Li, Dejuan Kong, Aamir Ahmad, Bin Bao, Fazlul H. Sarkar, \u0027Chapter 16: Augmenting the Efficacy of Chemo- and Radio-Therapy by Nutraceuticals: Evidence from Pre-Clinical and Clinical Trials\u0027, Fazlul H. Sarkar (editor), \u0027Nutraceuticals and Cancer\u0027, [http://books.google.com.au/books?id\u003ddi4v4jP9fawC\u0026amp;pg\u003dPA366\u0026amp;dq\u003d%22resveratrol%22%7C%22resveratrols%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dmOOGU6yYOsfOlAWcuIGQBQ\u0026amp;redir_esc\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22resveratrol%22%7C%22resveratrols%22\u0026amp;f\u003dfalse page 366\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Resveratrol\u0027\u0027 is a phytoalexin mainly found in grapes. Red wine contains a high level of \u0027\u0027resveratrol\u0027\u0027. \u0027\u0027Resveratrol\u0027\u0027 has been shown to prevent the development of mammary and other tumors in vivo in animal models (Bishayee 2009\", \"priority\":10}]}, \"synonyms\":{}}");

